import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import 'rxjs/add/operator/map';
import { Observable } from 'rxjs';

@Injectable()
export class HeaderService {

  footerimg = 'data:image/jpeg;base64,';

  headerimg = 'data:image/jpeg;base64,';

  encabezado = 0;
  mapa_ico = 'none';
  usr_ico = 'none';
  msj_ico = 'none';
  impact_ico = 'none';
  public url = 'http://rapidpro.datos.gob.mx';

  constructor(public http: HttpClient) { }

  get_Users(): Observable<any> {

    const datos = [];

    const query = this.url + `/unicef/users_by_channel`;
    return this.http.get(query).map((resp: any) => {
      let total = 0;


      for (const dato of resp.response) {
        total = total + parseInt(dato.count);
      }

      return total;

    });


  }

  get_Msj(): Observable<any> {
    const datos = [];

    const query = this.url + `/unicef/msgs_by_topic`;
    return this.http.get(query).map((resp: any) => {
      let total = 0;


      for (const dato of resp.response) {
        total = total + parseInt(dato.count);
      }

      /*  if(total>=1000 && total<1000000)
        {
          total = (total/1000);
          return total+"k";

        }*/

      return total;

    });
  }

  get_rate(): Observable<any> {
    const datos = [];

    const query = this.url + `/unicef/rate_by_state`;
    return this.http.get(query).map((resp: any) => {
      let total = 0;
      let conteo = 0;


      for (const dato of resp.response) {
        total = total + parseInt(dato.rate);
        conteo++;
      }

      return total / conteo;

    });
  }

  enter_change(icono) {

    switch (icono) {
      case 'map':
        if (this.mapa_ico != 'active') {
          this.mapa_ico = 'hover';

        }
        break;
      case 'user':
        if (this.usr_ico != 'active') {
          this.usr_ico = 'hover';

        }
        break;
      case 'msj':
        if (this.msj_ico != 'active') {
          this.msj_ico = 'hover';

        }
        break;
      case 'impact':
        if (this.impact_ico != 'active') {
          this.impact_ico = 'hover';

        }
        break;
    }

  }
  out_change(icono) {
    switch (icono) {
      case 'map':
        if (this.mapa_ico != 'active') {
          this.mapa_ico = 'none';

        }
        break;
      case 'user':
        if (this.usr_ico != 'active') {
          this.usr_ico = 'none';

        }
        break;
      case 'msj':
        if (this.msj_ico != 'active') {
          this.msj_ico = 'none';

        }
        break;
      case 'impact':
        if (this.impact_ico != 'active') {
          this.impact_ico = 'none';

        }
        break;
    }

  }
  active_change(icono) {
    switch (icono) {
      case 'map':

        this.mapa_ico = 'active';
        this.usr_ico = 'none';
        this.msj_ico = 'none';
        this.impact_ico = 'none';


        break;
      case 'user':
        this.mapa_ico = 'none';
        this.usr_ico = 'active';
        this.msj_ico = 'none';
        this.impact_ico = 'none';


        break;
      case 'msj':
        this.mapa_ico = 'none';
        this.msj_ico = 'active';
        this.usr_ico = 'none';
        this.impact_ico = 'none';


        break;
      case 'impact':
        this.mapa_ico = 'none';
        this.impact_ico = 'active';
        this.usr_ico = 'none';
        this.msj_ico = 'none';


        break;
    }

  }



}
